INSERT INTO `S_QUESTION` VALUES ('由于澳大利亚对动物的保护有严格规定，游客只能在哪个州抱考拉合照?', 'd2c80e997c264377b30382eb479dbc01', 'A.维多利亚州;B.新南威尔士州;C.西澳大利亚州;D.昆士兰州', 'D', '10', '0', '0', ''), ('澳大利亚被划分为几个州和几个领地?', 'd2c80e997c264377b30382eb479dbc02', 'A.5个州，2个领地;B.5个州，3个领地;C.6个州，2个领地;D.6个州，3个领地', 'C', '10', '0', '0', ''), ('澳大利亚地势最低处位于什么地方?', 'd2c80e997c264377b30382eb479dbc03', 'A.大堡礁;B.墨累河;C.艾尔湖', 'C', '10', '0', '0', ''), ('澳大利亚的人多还是袋鼠多？', 'd2c80e997c264377b30382eb479dbc04', 'A.袋鼠多;B.澳大利亚人多', 'B', '10', '0', '0', ''), ('澳大利亚的国土面积，在世界上排名第几位？', 'd2c80e997c264377b30382eb479dbc05', 'A.第一位;B.第二位;C.第六位;D.第十位', 'C', '10', '0', '0', ''), ('澳大利亚的第一和第二大城市，分别是？', 'd2c80e997c264377b30382eb479dbc06', 'A.悉尼、墨尔本;B.墨尔本、悉尼;C.悉尼、阿德莱德;D.墨尔本、珀斯', 'A', '10', '0', '0', ''), ('澳大利亚最大的河流是?', 'd2c80e997c264377b30382eb479dbc07', 'A.墨累河;B.泰晤士河;C.尼罗河;D.底格里斯河', 'A', '10', '0', '0', ''), ('汉堡王来到澳洲叫什么?', 'd2c80e997c264377b30382eb479dbc08', 'A.Pie Face;B.Macca’s;C.Hungry Jack’s', 'C', '10', '0', '0', ''), ('澳大利亚人最情有独钟的咖啡是什么?', 'd2c80e997c264377b30382eb479dbc09', 'A.Latte;B.Flat White;C.Black Coffee', 'B', '10', '0', '0', ''), ('袋鼠为什么会在澳洲国徽上?', 'd2c80e997c264377b30382eb479dbc10', 'A.长相可爱;B.跳得高;C.肉好吃,有营养;D.它只能向前移动不能后退', 'D', '10', '0', '0', ''), ('以下哪项是澳大利亚人发明的?', 'd2c80e997c264377b30382eb479dbc11', 'A.Wi-Fi;B.空调;C.手机', 'A', '10', '0', '0', ''), ('澳大利亚的国旗上有几颗星?', 'd2c80e997c264377b30382eb479dbc12', 'A.四颗;B.五颗;C.六颗;D.八颗', 'C', '10', '0', '0', ''), ('澳大利亚国歌Advance Australia Fair, 是在哪一年被选中的?', 'd2c80e997c264377b30382eb479dbc13', 'A.1984年;B.1985年;C.1986年;D.1987年', 'A', '10', '0', '0', ''), ('澳大利亚俚语“Arvo”的意思是?', 'd2c80e997c264377b30382eb479dbc14', 'A.到达;B.下午;C.我怎么知道', 'B', '10', '0', '0', ''), ('澳洲土著旗的颜色是什么?', 'd2c80e997c264377b30382eb479dbc15', 'A.黑、红、黄;B.绿、白、黑;C.蓝、白、绿', 'A', '10', '0', '0', ''), ('澳大利亚的Boxing Day是什么时候?', 'd2c80e997c264377b30382eb479dbc16', 'A.12月25日;B.12月26日;C.12月27日', 'B', '10', '0', '0', ''), ('澳大利亚的国家宝石是什么?', 'd2c80e997c264377b30382eb479dbc17', 'A.澳宝;B.金;C.钻石', 'A', '10', '0', '0', ''), ('澳大利亚的澳新军团日（ANZAC Day）,是哪一天?', 'd2c80e997c264377b30382eb479dbc18', 'A.10月1日;B.4月25日;C.1月26日', 'B', '10', '0', '0', ''), ('澳大利亚最大的州是哪个?', 'd2c80e997c264377b30382eb479dbc19', 'A.昆士兰州;B.南澳大利亚;C.西澳大利亚州', 'C', '10', '0', '0', ''), ('悉尼歌剧院的设计灵感是从哪来的?', 'd2c80e997c264377b30382eb479dbc20', 'A.帆船;B.贝壳;C.橘子瓣', 'C', '10', '0', '0', ''), ('../../images/timu/image1.png', 'd2c80e997c264377b30382eb479dbc21', 'A.55555;B.1;C.我数学不好', 'A', '10', '0', '0', ''), ('../../images/timu/image2.png', 'd2c80e997c264377b30382eb479dbc22', 'A.11个;B.12个;C.10个', 'A', '10', '0', '1', '刚的出现的圆圈中有几个点?'), ('../../images/timu/image3.png', 'd2c80e997c264377b30382eb479dbc23', 'A.42;B.17;C.9', 'B', '10', '0', '1', '刚出现的一组数字中第5个数字是什么?'), ('../../images/timu/image4.png', 'd2c80e997c264377b30382eb479dbc24', 'A.鼠标;B.汽车;C.钢笔', 'B', '10', '0', '1', '请问,刚出现的倒数第2个物件是什么?'), ('../../images/timu/image5.png', 'd2c80e997c264377b30382eb479dbc25', 'A.白色;B.蓝色;C.红色', 'C', '10', '0', '1', '上图中,床上的毯子是什么颜色的?'), ('../../images/timu/image6.png', 'd2c80e997c264377b30382eb479dbc26', 'A.绿色;B.黄色;C.红色', 'C', '10', '0', '1', '请问,正方形是什么颜色的?'), ('../../images/timu/image7.png', 'd2c80e997c264377b30382eb479dbc27', 'A.停在家里了;B.停在LG2;C.停在LG3', 'B', '10', '0', '1', '请问,我把车停哪了?'), ('../../images/timu/image8.png', 'd2c80e997c264377b30382eb479dbc28', 'A.iPhone;B.紫毛衣;C.手套', 'C', '10', '0', '1', '请问,我把什么弄丢了?'), ('../../images/timu/image9.png', 'd2c80e997c264377b30382eb479dbc29', 'A.1,4,6,11,14;B.1,4,5,8,14;C.1,4,7,11,15', 'A', '10', '1', '1', '../../images/timu/image21.png'), ('../../images/timu/image10.png', 'd2c80e997c264377b30382eb479dbc30', 'A.1,4,6,11,14;B.1,4,6,9,16;C.1,3,8,11,15', 'B', '10', '1', '1', '../../images/timu/image21.png'), ('../../images/timu/image11.png', 'd2c80e997c264377b30382eb479dbc31', 'A.1,4,6,11,14;B.4,9,11,14,16;C.1,5,7,11,15', 'B', '10', '1', '1', '../../images/timu/image21.png'), ('../../images/timu/image12.png', 'd2c80e997c264377b30382eb479dbc32', 'A.红、橙、黄、绿、紫、蓝;B.蓝、橙、黄、绿、紫、红;C.红、橙、黄、绿、蓝、紫', 'C', '10', '0', '1', '请问从1-6,方块的颜色依次为.'), ('../../images/timu/image13.png', 'd2c80e997c264377b30382eb479dbc33', 'A.左边的;B.右边的;C.我怎么知道', 'B', '10', '0', '1', '哪一个才是真正的皮卡丘?'), ('Bioglan的中文名字是什么?', 'd2c80e997c264377b30382eb479dbc34', 'A.宝兰;B.宝蓝;C.宝来;D.不管叫什么我都买', 'A', '10', '0', '0', ''), ('../../images/timu/image15.png', 'd2c80e997c264377b30382eb479dbc35', 'A.8个;B.9个;C.10个', 'A', '10', '0', '1', '请问,刚刚一共出现了几个数字?'), ('../../images/timu/image16.png', 'd2c80e997c264377b30382eb479dbc36', 'A.牙刷;B.生气;C.大雪', 'C', '10', '0', '1', '请问,7号对应的是什么?'), ('../../images/timu/image17.png', 'd2c80e997c264377b30382eb479dbc37', 'A.1842年;B.1492年;C.1876年', 'B', '10', '0', '1', '请问,哥伦布什么时候到达的美洲?'), ('../../images/timu/image18.png', 'd2c80e997c264377b30382eb479dbc38', 'A.扫把;B.橘猫;C.枕头和毯子', 'C', '10', '0', '1', '请问,刚刚图片里小女孩手里拿了什么?'), ('../../images/timu/image19.png', 'd2c80e997c264377b30382eb479dbc39', 'A.灰色;B.绿色;C.橙色', 'C', '10', '0', '1', '请问,数字最大的圈圈是什么颜色?'), ('../../images/timu/image20.png', 'd2c80e997c264377b30382eb479dbc40', 'A.绿色;B.黄色;C.橙色;D.蓝色', 'A', '10', '0', '1', '请问,数字2位于什么颜色的圈里面?');
